'use strict';
//@@DocInclude
//@@DocBrief("The resilience class")
class Resilience {
    attempts;
    periodInMilliseconds;
    getPeriodInMilliseconds() {
        return this.periodInMilliseconds;
    }
    getAttempts() {
        return this.attempts;
    }
    static create(attempts, periodInMilliseconds) {
        let instance;
        instance = new Resilience();
        instance.attempts = attempts;
        instance.periodInMilliseconds = periodInMilliseconds;
        return instance;
    }
}
module.exports = Resilience
